import React, { useState, useEffect } from 'react';
import ProductItem from './ProductItem';

const ProductList = () => {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    // TODO: Fetch products from backend API
    setProducts([
      { id: 1, name: 'Smartphone', price: 699, category: 'Electronics' },
      { id: 2, name: 'Laptop', price: 1299, category: 'Electronics' },
      { id: 3, name: 'Running Shoes', price: 120, category: 'Footwear' },
      { id: 4, name: 'Coffee Maker', price: 80, category: 'Home Appliances' },
      { id: 5, name: 'Bluetooth Headphones', price: 150, category: 'Electronics' },
      { id: 6, name: 'T-shirt', price: 25, category: 'Clothing' },
      { id: 7, name: 'Backpack', price: 60, category: 'Accessories' },
      { id: 8, name: 'Wrist Watch', price: 200, category: 'Accessories' },
    ]);
  }, []);

  const handleAddToCart = (product) => {
    // TODO: Implement add to cart logic
    console.log('Add to cart:', product);
  };

  return (
    <div className="product-list">
      <h2>Products</h2>
      {products.map(product => (
        <ProductItem key={product.id} product={product} onAddToCart={handleAddToCart} />
      ))}
    </div>
  );
};

export default ProductList;
